import React from 'react'

export default function App() {
  const persons = [
    ["Name","Subject","Rating"],
    ["Adfar","Coding","10"],
    ["Debayan","React","9"],
    ["Vaishali","HTML","8"]
  ]
  return (
    <div>
      <table>
        <thead>
          <tr>
            {persons.map((x)=>{
              return (
                <th>{x.map((y)=>{
                  return (
                    {y}
                  )
                })}</th>
              )
            })}
          </tr>
        </thead>
      </table>
    </div>
  )
}
